import styled from "styled-components";
import CommentListItem from "./CommentListItem";

const Wrapper = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  flex-direction: column;
`;

const CommentList = (props) => {
  return (
    <Wrapper>
      <CommentListItem />
    </Wrapper>
  );
};

export default CommentList;
